let error_class = "error-state";
let warning_class = "warn-state";
let ok_class = "ok-state";

function check_class(){
  console.error("working...");
  console.error(document.getElementsByClassName(error_class));
  if (document.getElementsByClassName(error_class).length > 0 || document.getElementsByClassName(warning_class).length > 0){
    beep();
  }
}
check_class()
const clock = setInterval(check_class,10000);

function beep() {
    var snd = new Audio("data:audio/wav;base64,");
    snd.play();
    snd.stop();
}
